import React from 'react';
import { NavLink } from 'react-router-dom'

const routes = [
    { to: '/', lavel: 'Home' },
    { to: '/about', label: 'About' },
];

const Nav = () => {
    const links = routes.map(({ to, label }) => {
        return <NavLink strict exact to={to}>{label}</NavLink>}
        )

        return <nav>{ links }</nav>;
}

export default Nav
